window.bookSummaryJSON = "<p><b>My kings and I have come as close to breaking as I ever could have feared.</b></p> <p>Just as we were finding a way to get past our difficulties, the stars have torn us apart. Can I fight against the will of the heavens, or does fate have something unforeseen in store for me now?</p> <p>While we're reeling from the wheel of fate and trying to find a way to move on with our lives, our enemies are only growing more powerful.</p> <p>Felix Oscura is haunting Alestria with his bloodthirsty need to steal the power of the clan he was never destined to rule over. And, the illusive King is growing closer to their goal of taking control of the entire city and maybe even beyond.</p> <p>With challenges around every corner, and the mysteries behind my brother's death slowly starting to unravel, will I be able to piece everything together, and find a way to overcome the will of the stars before itâ€™s too late?</p>"; 
